description:
Sanslos komedi om Coca-Colas man i Vast Berlin, som kommer att fa sparken om 
han inte kan hindra sin amerikanske chefs dotter fran att gifta sig med en kommunist.
Utspelar sig helt i det kalla krigets skugga.
Med bl.a.: James Cagney, Horst Buchholst och Pamela Tiffin.

